ui.create_sub("~o~Commonsense Recovery", "lua_main_tab")

local function set_int_stat(statINT)
    local newValue = ui.get_int(statINT)
    STATS.STAT_SET_INT(util.joaat(statINT), newValue, true)
end

local function set_float_stat(statFLOAT)
    local newValue = ui.get_float(statFLOAT)
    STATS.STAT_SET_FLOAT(util.joaat(statFLOAT), newValue, true)
end

local function set_bool_stat(statBOOL)
    local newValue = ui.get_int(statBOOL)
    STATS.STAT_SET_BOOL(util.joaat(statBOOL), newValue, true)
end

